import React from 'react';
import { Router } from '@reach/router';

import { Navbar, Button, Alignment, Classes, Colors } from '@blueprintjs/core';

const Home = () => (<>
    <div style={{ height: '100vh' }} className={Classes.DARK}>
        <Navbar>
            <Navbar.Group align={Alignment.LEFT}>
                <Navbar.Heading>votsec</Navbar.Heading>
                <Navbar.Divider />
                
                <Button text='lab' />
            </Navbar.Group>
        </Navbar>
    </div>
</>);

const Lab = () => (
    <p>
        This is the lab
    </p>
);

const App = () => (
    <Router>
        <Home path='/' />
        <Lab path='/lab' />
    </Router>
);

export default App;
